const Homepage= (props) =>{
    useEffect(() => {
        fetchPosts();
        saveIsLogged();
    }, [isLogged]);

    const fetchPosts = async () => {
        const data = await fetch(
            `http://127.0.0.1:8000/api/following_posts/${username}`
        );

        const post = await data.json();
        setPosts(post);
      //  console.log(post);
    };
    return(
        <Posts posts={props.posts} setPosts={props.setPosts}/>
    )
}

